"369202":{"id":"369202","name":"Lago Bodom","slug":"lago-bodom","original_title":"Bodom","overview":"O pior pesadelo de qualquer campista se tornou realidade no Lago Bodom em 1960, quando quatro adolescentes foram mortos a facadas enquanto dormiam em sua barraca. À medida que os anos passaram e o caso esfriou, o mistério não resolvido se transformou em uma lenda urbana, uma história assustadora de fogueira passada de geração em geração. Agora, um grupo de adolescentes chega ao mesmo acampamento, na esperança de solucionar o assassinato reconstruindo-o minuto a minuto. Ao cair da noite, acontece que nem todos estão lá para brincar. Esta noite... são meninas contra meninos. Deixe os jogos de matança começarem.","first_air_date":"2016-08-19","runtime":90,"episode_run_time":[90],"vote_average":5.3,"created_by":["Münchhausen","Don Films"],"production_companies":[{"name":"Münchhausen"},{"name":"Don Films"}],"cast":["Nelly Hirst-Gee","Mimosa Willamo","Mikael Gabriel","Santeri Helinheimo Mäntylä","Pirjo Lankinen"],"backdrop_path":"https://image.tmdb.org/t/p/original/heaHpK33jbxr2k9J8rwF1wT96HY.jpg","poster_path":"https://image.tmdb.org/t/p/original/wG3ouGuEKFX8XWuBkTsx1ckgdyL.jpg","certification":"16","genres":["Terror"],"trailer":"N/A"},
