"30239":{"id":"30239","name":"Vencer","slug":"vencer","original_title":"Vincere","overview":"A conturbada vida de Ida Dalser, amante de Benito Mussolini e mãe do seu filho Benito Albino. Um segredo considerado como ameaça, e por isso foi destruído, cancelado do mundo e da memória. Quando Ida Dalser conhece Mussolini, o futuro ditador é ainda um militante socialista radical. Os dois tem um filho, mas com a 1a Grande Guerra, Mussolini se alista e desaparece. Quando Ida o reencontra, ele já está casado com Rachele. Forçada a partir, Ida é levada para um hospício e seu filho conduzido a um internato.","first_air_date":"2009-05-20","runtime":128,"episode_run_time":[128],"vote_average":6.7,"created_by":["Celluloid Dreams","Offside","RAI Cinema"],"production_companies":[{"name":"Celluloid Dreams"},{"name":"Offside"},{"name":"RAI Cinema"}],"cast":["Giovanna Mezzogiorno","Filippo Timi","Fausto Russo Alesi","Michela Cescon","Pier Giorgio Bellocchio"],"backdrop_path":"https://image.tmdb.org/t/p/original/rUVkyw6hhLpDClAqX9SCbMi11X5.jpg","poster_path":"https://image.tmdb.org/t/p/original/uVz0QjrZM7YvEzQUcIR1dEwwNAM.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
