"691214":{"id":"691214","name":"Pacifiction","slug":"pacifiction","original_title":"Pacifiction","overview":"Em Pacifiction, em uma ilha da Polinésia Francesa, uma escritora retorna ao seu país depois de ter triunfado na França com um romance. No entanto, ela está desorientada e em crise criativa. Diante da impossibilidade de escrever novos trabalhos, ela decide aceitar um trabalho de tradução simultânea junto com um embaixador. Uma estranha atração amorosa começa entre eles, cheia de contrastes. Aos poucos ela percebe o cinismo da política internacional, com uma ameaça latente de novos testes nucleares por parte do governo francês. Seu caso de amor com o embaixador será afetado por esse conflito, e interesses políticos e romance se misturam.","first_air_date":"2022-09-02","runtime":165,"episode_run_time":[165],"vote_average":6.4,"created_by":["Andergraun Films","Idéale Audience","Rosa Filmes","ARTE France Cinéma","Lupa Film","Tamtam Film","BR","Archipel Production"],"production_companies":[{"name":"Andergraun Films"},{"name":"Idéale Audience"},{"name":"Rosa Filmes"},{"name":"ARTE France Cinéma"},{"name":"Lupa Film"},{"name":"Tamtam Film"},{"name":"BR"},{"name":"Archipel Production"}],"cast":["Benoît Magimel","Pahoa Mahagafanau","Marc Susini","Matahi Pambrun","Sergi López"],"backdrop_path":"https://image.tmdb.org/t/p/original/ccE09Tf0W38uPV1GoQJKvopg0R0.jpg","poster_path":"https://image.tmdb.org/t/p/original/oXkEO5QBW7EG24BjGm9LqIJ1rpt.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
