"6106":{"id":"6106","name":"Salvador - O Martírio de um Povo","slug":"salvador-o-martirio-de-um-povo","original_title":"Salvador","overview":"Um fotojornalista americano se vê envolvido na luta política em El Salvador, em 1980. Um jornalista, com pouca sorte nos Estados Unidos, vai para El Salvador para reportar os eventos da ditadura militar de 1980, incluindo o assassinato do arcebispo Oscar Romero. Ele faz uma aliança desconfortável com dois guerrilheiros que querem que ele tire fotos para a imprensa americana, e também com os militares de direita, que querem que ele lhes traga fotos dos rebeldes. Além disso, ele tem que encontrar uma maneira de proteger sua namorada salvadorenha e levá-la para fora do país.","first_air_date":"1986-04-23","runtime":123,"episode_run_time":[123],"vote_average":7.0,"created_by":["Hemdale","Cinema '85","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Hemdale"},{"name":"Cinema '85"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["James Woods","Jim Belushi","Michael Murphy","John Savage","Elpidia Carrillo"],"backdrop_path":"https://image.tmdb.org/t/p/original/6DSXD0cSOOQJd9YX7KUekv6bKLr.jpg","poster_path":"https://image.tmdb.org/t/p/original/eKpdJYdhpfhutKmsEb28m9WyJJu.jpg","certification":"16","genres":["Drama","Thriller","Guerra"],"trailer":"N/A"},
"920220":{"id":"920220","name":"Padre Johnny","slug":"padre-johnny","original_title":"Johnny","overview":"Patryk invade uma casa em uma pequena cidade. Ele é condenado a serviços comunitários no hospício em Puck, onde conhece o pai Jan Kaczkowski, que é uma pessoa bastante incomum. O padre envolve meninos da escola vocacional, que parecem ser rebeldes durões, para ajudar os doentes terminais. Em seu trabalho, ele foca na intimidade, no afeto e na luta para estabelecer uma conexão com outras pessoas. Ele ensina empatia. E faz isso com muito senso de humor, o que lhe rendeu enorme popularidade. Pouco depois, o próprio padre Jan torna-se paciente do hospício. Patryk é colocado em uma posição que mudará toda a sua vida. Baseado em uma história real.","first_air_date":"2022-09-23","runtime":120,"episode_run_time":[120],"vote_average":7.4,"created_by":["Next Film","TVN Group","Moderator Inwestycje","Warmia Resort","Visual Work Rebel Media","Festival Group","Pressprom","Abstraction Plan","Muzk Management","Salander","Esmetric","Cine Line","Dobra Robota","CineLine","Dreamsound"],"production_companies":[{"name":"Next Film"},{"name":"TVN Group"},{"name":"Moderator Inwestycje"},{"name":"Warmia Resort"},{"name":"Visual Work Rebel Media"},{"name":"Festival Group"},{"name":"Pressprom"},{"name":"Abstraction Plan"},{"name":"Muzk Management"},{"name":"Salander"},{"name":"Esmetric"},{"name":"Cine Line"},{"name":"Dobra Robota"},{"name":"CineLine"},{"name":"Dreamsound"}],"cast":["Dawid Ogrodnik","Piotr Trojan","Beata Zygarlicka","Grażyna Bułka","Maria Pakulnis"],"backdrop_path":"https://image.tmdb.org/t/p/original/jtZix01UdmEmrZoGYy96zKNhC0I.jpg","poster_path":"https://image.tmdb.org/t/p/original/3E318VICmJuZ8t0tRSiHahBbHTp.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"128154":{"id":"128154","name":"Além da Fronteira","slug":"alem-da-fronteira","original_title":"Out in the Dark","overview":"Nimer, um estudante palestino, e Roy, um advogado israelense, apaixonam-se desde a primeira vez em que se encontram. À medida em que a relação dos dois se desenvolve, Nimer tem que lidar com sua família conservadora e com sua condição de palestino morando em Israel. A situação piora quando um amigo próximo é capturado em Tel Aviv e assassinado na Cisjordânia.","first_air_date":"2012-09-09","runtime":95,"episode_run_time":[95],"vote_average":6.9,"created_by":["M7200 Productions","Periscope Productions"],"production_companies":[{"name":"M7200 Productions"},{"name":"Periscope Productions"}],"cast":["מיכאל אלוני","Nicholas Jacob","Loai Nofi","Alon Pdut","Khawlah Hag-Debsy"],"backdrop_path":"https://image.tmdb.org/t/p/original/aBwbgdmsCZBZ7trw8fDznPWsCne.jpg","poster_path":"https://image.tmdb.org/t/p/original/bJN5u4BmbpD7XDeOPFOEfBt1ddl.jpg","certification":"12","genres":["Drama","Romance","Thriller"],"trailer":"N/A"},
"9095":{"id":"9095","name":"O Segredo de Mary Reilly","slug":"o-segredo-de-mary-reilly","original_title":"Mary Reilly","overview":"No século XIX na Inglaterra, uma arrumadeira (Julia Roberts) vai trabalhar na casa de um médico conceituado e rico (John Malkovich). Entretanto, este médico é o Dr. Jekyll e, apesar de idolatrar seu patrão, ela gradativamente descobre que ele é um homem desesperado, que esconde um terrível segredo que envolve seu assistente, o senhor Hyde.","first_air_date":"1996-02-23","runtime":108,"episode_run_time":[108],"vote_average":5.8,"created_by":["NFH Films","TriStar Pictures"],"production_companies":[{"name":"NFH Films"},{"name":"TriStar Pictures"}],"cast":["Julia Roberts","John Malkovich","George Cole","Michael Gambon","Glenn Close"],"backdrop_path":"https://image.tmdb.org/t/p/original/mErnrp6gxgSw7eYVnuos3k8EkWf.jpg","poster_path":"https://image.tmdb.org/t/p/original/kd73cQBSjTeM6DgW00vXbQK9PrO.jpg","certification":"N/A","genres":["Drama","Terror","Thriller"],"trailer":"N/A"},
"22473":{"id":"22473","name":"O Segredo de Neverwas","slug":"o-segredo-de-neverwas","original_title":"Neverwas","overview":"Zach Riley (Aaron Eckhart) é um psiquiatra que deixou o emprego em uma universidade de renome para trabalhar em um instituto privado para doentes mentais, que pertence ao dr. Reed (William Hurt). Zach tem interesses pessoais no local, já que seu pai, o escritor T.L. Pierson (Nick Nolte), esteve internado lá em seus últimos anos de vida. Autor de \"Neverwas\", um best-seller infantil, Pierce jamais foi próximo ao filho. É através de Gabriel Finch (Ian McKellen), um paciente esquizofrênico, que Zach passa a conhecer melhor quem foi seu pai e como foi o processo de elaboração de seu grande sucesso literário.","first_air_date":"2005-09-09","runtime":103,"episode_run_time":[103],"vote_average":6.3,"created_by":["Legacy Filmworks","Neverwas Productions"],"production_companies":[{"name":"Legacy Filmworks"},{"name":"Neverwas Productions"}],"cast":["Ian McKellen","Aaron Eckhart","Brittany Murphy","Nick Nolte","Jessica Lange"],"backdrop_path":"https://image.tmdb.org/t/p/original/qOx8xsS2ph3Styv93GpAVC7jOr0.jpg","poster_path":"https://image.tmdb.org/t/p/original/xobCmr45MYhKEO4UQEPJGZFmUYk.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
