"835975":{"id":"835975","name":"Great Freedom","slug":"great-freedom","original_title":"Große Freiheit","overview":"Na Alemanha do pós-guerra, Hans é constantemente preso por ser homossexual. Devido ao parágrafo 175 do código penal alemão, que tornava atos homossexuais entre homens um crime, sua liberdade é destruída de forma sistemática. O único relacionamento estável em sua vida será com seu companheiro de cela de longa data, Viktor, um assassino condenado. O que começa como repulsa, logo se transformará em amor. Representante da Áustria no Oscar 2022 de Filme Internacional e um dos 15 semifinalistas. Vencedor do Prêmio do Júri da seção Um Certo Olhar do Festival de Cannes 2021. Seleção da Mostra de Cinema de São Paulo 2021.","first_air_date":"2021-11-18","runtime":116,"episode_run_time":[116],"vote_average":7.3,"created_by":["FreibeuterFilm","Rohfilm"],"production_companies":[{"name":"FreibeuterFilm"},{"name":"Rohfilm"}],"cast":["Franz Rogowski","Georg Friedrich","Anton von Lucke","Thomas Prenn","Thomas Stecher"],"backdrop_path":"https://image.tmdb.org/t/p/original/74LbwKx0VqQ2bYE2oVkZqcjQQY.jpg","poster_path":"https://image.tmdb.org/t/p/original/1BThmK4bbN4ECPtWfP8pMgQpxdE.jpg","certification":"N/A","genres":["Drama","Romance","Crime"],"trailer":"N/A"},
