"535683":{"id":"535683","name":"Um Amor Inesperado","slug":"um-amor-inesperado","original_title":"El amor menos pensado","overview":"Marcos e Ana (50) são casados há vinte e cinco anos. Com a saída do filho único para iniciar sua carreira universitária no exterior, o casal entra em uma profunda crise existencial. Sem disputa no meio, quase como se fosse um novo projeto em comum, eles decidem se separar. O que seria, claro e simples, uma separação de acordo comum. A vida dos solteiros, intensa e fascinante no início, logo levanta novas questões e incertezas. Marcos e Ana, se perguntam profundamente sobre o amor, a natureza do desejo, a fidelidade e tomam uma decisão que mudará suas vidas para sempre.","first_air_date":"2018-08-02","runtime":136,"episode_run_time":[136],"vote_average":6.3,"created_by":["Kenya Films","Boneco Films","Patagonik"],"production_companies":[{"name":"Kenya Films"},{"name":"Boneco Films"},{"name":"Patagonik"}],"cast":["Ricardo Darín","Mercedes Morán","Claudia Fontán","Andrea Pietra","Mariu Fernández"],"backdrop_path":"https://image.tmdb.org/t/p/original/zyRHkfUtplslMEVA6TKOX0CO3vm.jpg","poster_path":"https://image.tmdb.org/t/p/original/innH2zbhjqeTKbMpX2j3gxPuQ1i.jpg","certification":"14","genres":["Comédia","Romance"],"trailer":"N/A"},
