"154441":{"id":"154441","name":"Até que a Sorte nos Separe","slug":"ate-que-a-sorte-nos-separe","original_title":"Até que a Sorte nos Separe","overview":"Tino (Leandro Hassum) é um pai de família comum que vê sua vida virar de ponta a cabeça após ganhar na loteria. Levando uma vida de ostentação ao lado da mulher, Jane (Danielle Winits), ele gasta todo o dinheiro em 15 anos. Ao se ver quebrado, Tino aceita a ajuda do vizinho Amauri (Kiko Mascarenhas), um consultor de finanças super burocrático e que por sinal vive seu próprio drama ao enfrentar uma crise no casamento com Laura (Rita Elmôr). Tentando evitar que Jane descubra a nova situação financeira, afinal ela está grávida do terceiro filho não pode passar por fortes emoções, Tino se envolve em várias confusões para fingir que tudo continua bem. Para isso, conta com ajuda do melhor amigo, Adelson (Aílton Graça), e dos filhos.","first_air_date":"2012-10-05","runtime":104,"episode_run_time":[104],"vote_average":6.4,"created_by":["Globo Filmes","Gullane Entretenimento","Paris Filmes","RioFilme","Telecine"],"production_companies":[{"name":"Globo Filmes"},{"name":"Gullane Entretenimento"},{"name":"Paris Filmes"},{"name":"RioFilme"},{"name":"Telecine"}],"cast":["Leandro Hassum","Danielle Winits","Kiko Mascarenhas","Rita Elmôr","Aílton Graça"],"backdrop_path":"https://image.tmdb.org/t/p/original/aDu4NawDawBsBkRiEJUU2NDKdv.jpg","poster_path":"https://image.tmdb.org/t/p/original/xAd1DeclHsJ0lnrizw4bTYivFqB.jpg","certification":"12","genres":["Comédia"],"trailer":"dAnzuTb-A8k"},
"47608":{"id":"47608","name":"Amor Louco","slug":"amor-louco","original_title":"Mad Love","overview":"Na beira de uma bela lagoa vive um rapaz, Matt Leland (Chris O'Donnell), que tem o hábito de ver as estrelas com um telescópio. Numa noite ele vê Casey Roberts (Drew Barrymore), uma bela jovem que mora no outro extremo da lagoa. Matt sente-se muito atraído por ela e traça um plano para conhecê-la, atingindo seu objetivo. Porém Matt ignora o fato de que Casey tem acessos de depressão e esteve em várias instituições psiquiátricas, por boa parte da sua vida. O pai dela, Richard (Jude Cicciolella), quer manter a filha em um sanatório, enquanto que sua mãe, Margaret (Joan Allen), quer o melhor para sua filha mas não está certa do que Casey precisa. Após dar um falso alarme de incêndio para falar com Matt sobre uma noite de autógrafos, Casey é novamente internada. Matt a ajuda a fugir do sanatório e, juntos, decidem ir para o México. Entretanto durante a fuga Matt constata que o modo de Casey agir é mais sério do que ele imaginava.","first_air_date":"1995-05-26","runtime":95,"episode_run_time":[95],"vote_average":5.2,"created_by":["Touchstone Pictures"],"production_companies":[{"name":"Touchstone Pictures"}],"cast":["Chris O'Donnell","Drew Barrymore","Matthew Lillard","Richard Chaim","Robert Nadir"],"backdrop_path":"https://image.tmdb.org/t/p/original/8njBiJUriBw4wrT6FoVpYA57wdG.jpg","poster_path":"https://image.tmdb.org/t/p/original/la5DFbmwFOPVYzBGdMY93xzVyk9.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
