"18840":{"id":"18840","name":"A Condessa Branca","slug":"a-condessa-branca","original_title":"The White Countess","overview":"Um diplomata cego norte-americano abre uma casa noturna e acaba abrigando no local uma aristocrata russa refugiada que está tentando ganhar a vida como pode. Ela logo se torna a atração principal do local, mas a beira de um cenário conturbado e com uma guerra civil prestes a explodir, ela passa por uma série de dificuldades. Ao mesmo tempo, o seu protetor também tenta controlar as pressões da melhor maneira possível, mas as coisas estão cada vez mais complicadas e tudo se transforma em uma grande corrida para que a jovem russa consiga reencontrar a sua filha. Enquanto tudo isso acontece, os dois percebem que existe algo mais entre eles.","first_air_date":"2005-10-30","runtime":135,"episode_run_time":[135],"vote_average":6.3,"created_by":["Shanghai Film Group","Merchant Ivory Productions","China Film Co-Production Corp.","Rising Star Productions","Global Cinema Group","Sony Pictures Classics","VIP Medienfonds 3","Global Cinema"],"production_companies":[{"name":"Shanghai Film Group"},{"name":"Merchant Ivory Productions"},{"name":"China Film Co-Production Corp."},{"name":"Rising Star Productions"},{"name":"Global Cinema Group"},{"name":"Sony Pictures Classics"},{"name":"VIP Medienfonds 3"},{"name":"Global Cinema"}],"cast":["Ralph Fiennes","Natasha Richardson","Hiroyuki Sanada","Lynn Redgrave","Vanessa Redgrave"],"backdrop_path":"https://image.tmdb.org/t/p/original/6coKuJMLZnX1Us87n5H51giDC5C.jpg","poster_path":"https://image.tmdb.org/t/p/original/7OMejX4AHgS0dDbtEjqg0R0vuzE.jpg","certification":"N/A","genres":["Drama","História","Família","Romance","Guerra"],"trailer":"N/A"},
