"390582":{"id":"390582","name":"Here Alone","slug":"here-alone","original_title":"Here Alone","overview":"Um vírus tem devastado a civilização humana, deixando dois grupos de sobreviventes: aqueles que conseguiram evitar a infecção, e aqueles levados à loucura, violência e uma sede de sangue insaciável. Vivendo no meio da floresta, Ann, Chris, e Olivia são obrigados a se manterem afastados dos infectados enquanto buscam e exploram recursos alimentares para abastecimento. Mas quando uma expedição em busca de suplementos ocorre terrivelmente errado, um deles terá de fazer uma terrível escolha.","first_air_date":"2016-09-16","runtime":97,"episode_run_time":[97],"vote_average":5.5,"created_by":["Easy Open Productions","Gentile Entertainment Group","Preferred Content"],"production_companies":[{"name":"Easy Open Productions"},{"name":"Gentile Entertainment Group"},{"name":"Preferred Content"}],"cast":["Lucy Walters","Gina Piersanti","Adam David Thompson","Shane West"],"backdrop_path":"https://image.tmdb.org/t/p/original/htB4lYcSFjMcs3ukSVUbfNhJMT3.jpg","poster_path":"https://image.tmdb.org/t/p/original/yGWKF9ugBMtru4dcZVQ89xKnDOk.jpg","certification":"N/A","genres":["Terror","Thriller","Ficção científica"],"trailer":"N/A"},
