"43420":{"id":"43420","name":"Cinema, Aspirinas e Urubus","slug":"cinema-aspirinas-e-urubus","original_title":"Cinema, Aspirinas e Urubus","overview":"O ano é 1942, o mundo vive a Segunda Guerra Mundial. Um alemão de nome Johann dirige um caminhão carregado de frascos de Aspirina e filmes com propagandas do produto. Nessa viagem, Johann conhece um país, ao mesmo tempo que escapa das notícias da guerra. Ranulpho, morador de uma pequena vila, faz o percurso inverso, ou seja, está indo buscar uma vida melhor no promissor e industrializado sudeste do país e, para isso, deixa sua pequena cidade natal rumo ao Rio de Janeiro. Numa estrada árida e desabitada, acontece o encontro ocasional desses dois personagens. Interesses em comum e a promessa de cada um chegar ao seu destino, faz com que Johann e Ranulpho partam nessa aventura juntos. Uma aventura que vai mudar suas vidas para sempre. Um road-movie emocionante vivido por personagens inesquecíveis.","first_air_date":"2005-05-17","runtime":99,"episode_run_time":[99],"vote_average":7.0,"created_by":["REC Produtores Associados","Dezenove Som e Imagem","Quanta Centro de Produções Cinematográficas"],"production_companies":[{"name":"REC Produtores Associados"},{"name":"Dezenove Som e Imagem"},{"name":"Quanta Centro de Produções Cinematográficas"}],"cast":["Peter Ketnath","João Miguel","Mano Fialho","Francisco Figueiredo","Arilson Lopes"],"backdrop_path":"https://image.tmdb.org/t/p/original/tnf0o78SWhaLqMgfdqhNwsPeDUW.jpg","poster_path":"https://image.tmdb.org/t/p/original/dJc05ctqZrffQPQ2vFKjjRpIfFE.jpg","certification":"14","genres":["Drama"],"trailer":"pKRA8gce0zM"},
"390777":{"id":"390777","name":"Mundo Ordinário","slug":"mundo-ordinario","original_title":"Ordinary World","overview":"Perry é um homem feliz com o seu casamento e pai de duas crianças. No seu aniversário de 40 anos, ele busca lembrar da sua vida antiga, quando era o vocalista de uma popular banda punk, e decide dar uma extravagante festa em um hotel, onde encontra sua ex-namorada e antigos parceiros do grupo.","first_air_date":"2016-10-14","runtime":86,"episode_run_time":[86],"vote_average":5.8,"created_by":["Process Media"],"production_companies":[{"name":"Process Media"}],"cast":["Billie Joe Armstrong","Fred Armisen","Judy Greer","Selma Blair","Chris Messina"],"backdrop_path":"https://image.tmdb.org/t/p/original/bCCRERgn8GpdZ4IUJLgQe0schwF.jpg","poster_path":"https://image.tmdb.org/t/p/original/mEJGrkLvo34nJDLjmLGIqb3SvPb.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
