"972119":{"id":"972119","name":"Cinema é Uma Droga Pesada","slug":"cinema-e-uma-droga-pesada","original_title":"Making Of","overview":"Simon, um diretor experiente, começa a rodar um filme sobre a luta dos trabalhadores para salvar sua fábrica. Mas nada sai como planejado. Sua produtora deseja reescrever o final, sua equipe entra em greve, sua vida pessoal está em ruínas; e para piorar as coisas, o ator principal é um desagradavel egocêntrico. Joseph, um jovem que deseja entrar na indústria do cinema, aceita dirigir o making of. Ele leva seu papel muito a sério e começa a capturar toda a confusão, provando que o making of pode às vezes ser bem melhor que o próprio filme!","first_air_date":"2024-01-10","runtime":119,"episode_run_time":[119],"vote_average":5.7,"created_by":["France 2 Cinéma","uMedia","Curiosa Films","Tropdebonheur Productions"],"production_companies":[{"name":"France 2 Cinéma"},{"name":"uMedia"},{"name":"Curiosa Films"},{"name":"Tropdebonheur Productions"}],"cast":["Denis Podalydès","Jonathan Cohen","Stefan Crepon","Souheila Yacoub","Emmanuelle Bercot"],"backdrop_path":"https://image.tmdb.org/t/p/original/sIfjszR9RhjgzvfzV5AvQfvjVlg.jpg","poster_path":"https://image.tmdb.org/t/p/original/gcHBds2kwBxUCGFrB3zGhrMWONi.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
