"244539":{"id":"244539","name":"Sentimentos que Curam","slug":"sentimentos-que-curam","original_title":"Infinitely Polar Bear","overview":"Boston, Estados Unidos. O fato de Cameron (Mark Ruffalo) ser maníaco-depressivo não impediu que Maggie (Zoe Saldana) se envolvesse com ele. O casal teve duas filhas, mas os constantes colapsos nervosos de Cameron fizeram com que eles deixassem de morar juntos, por mais que mantivessem contato constante. Em 1978, devido às dificuldades financeiras, Maggie resolve fazer um curso de especialização em Nova York, com duração de 18 meses. A saída para que o plano dê certo é que Cameron deixe o hospital psiquiátrico em que vive para voltar a morar em casa, cuidando das garotas, com Maggie visitando o trio aos finais de semana. Trata-se de um grande desafio para Cameron, que precisa assumir de vez as responsabilidades de pai e aprender a controlar a própria doença.","first_air_date":"2014-01-18","runtime":87,"episode_run_time":[87],"vote_average":6.6,"created_by":["Park Pictures Features","Paper Street Films","Bad Robot","KGB Media"],"production_companies":[{"name":"Park Pictures Features"},{"name":"Paper Street Films"},{"name":"Bad Robot"},{"name":"KGB Media"}],"cast":["Mark Ruffalo","Zoe Saldaña","Imogene Wolodarsky","Ashley Aufderheide","Wallace Wolodarsky"],"backdrop_path":"https://image.tmdb.org/t/p/original/cgu22PGyj7Bi5sSGA5VuymI2Z7n.jpg","poster_path":"https://image.tmdb.org/t/p/original/VEGbDdtOrj6PXnTlCKm3Q8XO2w.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
