"35215":{"id":"35215","name":"A Casa Inteligente","slug":"a-casa-inteligente","original_title":"Smart House","overview":"Ben é um garoto de 13 anos que ganha uma casa computadorizada comandada por uma empregada ciborgue chamada PAT. Quando ele, o pai e a irmã se mudam para a casa, ele conclui que o pai não vai considerar se casar novamente, já que a casa e PAT podem lidar com todas as tarefas de cozinhar e limpeza. No entanto, seu pai logo mostra interesse na programadora da casa, Sara. Isso faz com que o garoto reprograme a casa, mas acaba trazendo uma robô muito irritante, como a esposa (e a mãe).","first_air_date":"1999-06-26","runtime":82,"episode_run_time":[82],"vote_average":5.9,"created_by":["Alan Sacks Productions"],"production_companies":[{"name":"Alan Sacks Productions"}],"cast":["Katey Sagal","Ryan Merriman","Katie Volding","Kevin Kilner","Jessica Steen"],"backdrop_path":"https://image.tmdb.org/t/p/original/4CXEDuM5LA8VlodhLAoylf0IEl6.jpg","poster_path":"https://image.tmdb.org/t/p/original/qIOzpyrKc62uY4RZYcH3s4RsM5P.jpg","certification":"N/A","genres":["Cinema TV","Drama","Comédia","Família","Ficção científica"],"trailer":"N/A"},
