"910596":{"id":"910596","name":"Correr Atirando","slug":"correr-atirando","original_title":"Run & Gun","overview":"Depois de deixar uma vida de crime e violência, Ray é um mocinho reformado, desfrutando de uma vida familiar tranquila nos subúrbios. Mas quando seu passado é descoberto, Ray é chantageado em um último trabalho para coletar um pacote misterioso. Depois de uma traição mortal, ele se vê ferido e fugindo de assassinos implacáveis ​​que não vão parar por nada para conseguir o que ele tem. Agora, com a vida de seus entes queridos em jogo e perigo a cada passo, a única esperança de Ray é recorrer ao seu passado violento para sobreviver.","first_air_date":"2022-01-11","runtime":96,"episode_run_time":[96],"vote_average":5.5,"created_by":[],"production_companies":[],"cast":["Ben Milliken","Brad William Henke","Janel Parrish","Mark Dacascos","Celestino Cornielle"],"backdrop_path":"https://image.tmdb.org/t/p/original/32EzAHJg8daU0FHfncq4C3bAhja.jpg","poster_path":"https://image.tmdb.org/t/p/original/j252tH00eMyANiqhaLkemlkO16v.jpg","certification":"18","genres":["Ação","Thriller"],"trailer":"0FVcU31edtE"},
