"245846":{"id":"245846","name":"Terra Estranha","slug":"terra-estranha","original_title":"Strangerland","overview":"O casal Catherine (Nicole Kidman) e Matt (Joseph Fiennes) acaba de se mudar para o deserto australiano de Nathgari com os dois filhos adolescentes. Esta família é reservada e mantém pouco contato com as pessoas ao redor, até um dia em que uma grande tempestade de areia atinge a região, e os filhos do casal desaparecem. Com a ajuda de um policial, os pais procuram desesperadamente, sabendo que a alta temperatura e a falta de comida ou água pode causar a morte rápida de ambos. Enquanto isso, rumores começam a correr na vizinhança de que a culpa seria de Catherine e Matt, fazendo com que todos ao redor fiquem contra eles.","first_air_date":"2015-07-01","runtime":112,"episode_run_time":[112],"vote_average":5.3,"created_by":["Screen Australia","Worldview Entertainment","Screen NSW","Fís Éireann/Screen Ireland","Wild Bunch","Dragonfly Pictures","Fastnet Films"],"production_companies":[{"name":"Screen Australia"},{"name":"Worldview Entertainment"},{"name":"Screen NSW"},{"name":"Fís Éireann/Screen Ireland"},{"name":"Wild Bunch"},{"name":"Dragonfly Pictures"},{"name":"Fastnet Films"}],"cast":["Nicole Kidman","Joseph Fiennes","Hugo Weaving","Lisa Flanagan","Megan Alston"],"backdrop_path":"https://image.tmdb.org/t/p/original/zNI8YPHASNXiguZ9zLFgZYhYanJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/gOzUiyLzhtFFM21bLqbShcGDmWF.jpg","certification":"14","genres":["Drama","Thriller","Mistério"],"trailer":"8jWa6Cn08TQ"},
