"228177":{"id":"228177","name":"Até Que a Sorte nos Separe 2","slug":"ate-que-a-sorte-nos-separe-2","original_title":"Até Que a Sorte nos Separe 2","overview":"Três anos depois, Tino (Leandro Hassum) e Jane (Camila Morgado) estão mais uma vez em dificuldades financeiras. O saldo bancário do casal é salvo graças ao inesperado falecimento de tio Olavinho, que deixou uma herança de R$ 100 milhões a ser dividida igualmente entre Jane e sua mãe, Estela (Arlete Salles). Como o último desejo do tio foi que suas cinzas sejam jogadas no Grand Canyon, Tino aproveita para levar a esposa e dois de seus filhos para conhecer Las Vegas. Entretanto, ele se empolga com a jogatina de um cassino e perde todo o dinheiro ganho por Jane na mesa de pôquer. Para piorar a situação, ainda fica devendo US$ 10 milhões a um capanga da máfia mexicana (Charles Paraventi), que deseja receber o dinheiro a todo custo.","first_air_date":"2013-12-27","runtime":102,"episode_run_time":[102],"vote_average":5.7,"created_by":["Gullane Entretenimento","Globo Filmes","Paris Filmes","RioFilme","Telecine"],"production_companies":[{"name":"Gullane Entretenimento"},{"name":"Globo Filmes"},{"name":"Paris Filmes"},{"name":"RioFilme"},{"name":"Telecine"}],"cast":["Leandro Hassum","Camila Morgado","Kiko Mascarenhas","Rita Elmôr","Julia Dalavia"],"backdrop_path":"https://image.tmdb.org/t/p/original/y3PcQfhWQf7MTh2BApJ01cJsO6t.jpg","poster_path":"https://image.tmdb.org/t/p/original/eacRaUVzVbG40BbCw3RGhZyejbj.jpg","certification":"12","genres":["Comédia"],"trailer":"N/A"},
