"515818":{"id":"515818","name":"Jornada da Vida","slug":"jornada-da-vida","original_title":"Yao","overview":"Em seu vilarejo no norte do Senegal, Yao é um garoto de 13 anos de idade disposto a tudo para encontrar o seu herói: Seydou Tall, um famoso ator francês. Convidado a promover o seu novo livro em Dakar, Tall retorna ao país de origem pela primeira vez. Para realizar o seu sonho, o jovem Yao prepara uma fuga e atravessa 387 quilômetros sozinho até a capital. Comovido com este jovem, o ator decide fugir às obrigações e acompanhá-lo de volta à sua casa. No entanto, pelas estradas empoeiradas e incertas do Senegal, Tall compreende que ao se dirigir ao vilarejo do garoto, ele também parte ao encontro de suas raízes.","first_air_date":"2019-01-23","runtime":103,"episode_run_time":[103],"vote_average":6.5,"created_by":["Pan-Européenne","Korokoro","France 2 Cinéma"],"production_companies":[{"name":"Pan-Européenne"},{"name":"Korokoro"},{"name":"France 2 Cinéma"}],"cast":["Omar Sy","Fatoumata Diawara","Lionel Louis Basse","Germaine Acogny","Alibeta"],"backdrop_path":"https://image.tmdb.org/t/p/original/yChXbkfXSFPx5mR416s6GYGGM5a.jpg","poster_path":"https://image.tmdb.org/t/p/original/w3m808k9exmLflh1ltiJZGv0HAD.jpg","certification":"10","genres":["Comédia","Drama"],"trailer":"PC31Q07ZiAI"},
"611751":{"id":"611751","name":"Miss França","slug":"miss-franca","original_title":"Miss","overview":"Alex, um gracioso menino de 9 anos que navega entre gêneros, tem um sonho: ser um dia eleito Miss França. 15 anos depois, Alex perdeu seus pais e sua autoconfiança e estagnou em uma vida monótona. Uma reunião inesperada vai acordar esse sonho esquecido. Alex decide competir na Miss França, escondendo sua identidade. Beleza, excelência, camaradagem. À mercê das etapas de uma competição impiedosa, ajudada por uma família de corações coloridos, Alex vai conquistar o título, sua feminilidade e acima de tudo, a si mesmo.","first_air_date":"2020-10-21","runtime":107,"episode_run_time":[107],"vote_average":7.2,"created_by":["Chapka Films","Zazi Films","Pandora Filmes","Warner Bros. Entertainment France"],"production_companies":[{"name":"Chapka Films"},{"name":"Zazi Films"},{"name":"Pandora Filmes"},{"name":"Warner Bros. Entertainment France"}],"cast":["Alexandre Wetter","Pascale Arbillot","Isabelle Nanty","Thibault de Montalembert","Stéfi Celma"],"backdrop_path":"https://image.tmdb.org/t/p/original/o9BxMhL2ZlLTgmEeQ829PZc1jKT.jpg","poster_path":"https://image.tmdb.org/t/p/original/etEyeFdrO6OEta3fDZsima3Eqic.jpg","certification":"N/A","genres":["Comédia","Drama"],"trailer":"N/A"},
