"18065":{"id":"18065","name":"Cadê a Minha Entrega?","slug":"cade-a-minha-entrega","original_title":"Next Day Air","overview":"Um entregador descuidado faz a entrega de um pacote de droga pura em um endereço errado. Dois amigos abrem a caixa e acreditam ter tirado a sorte grande. Imediatamente eles vendem a droga para um primo traficante, tentando lucrar um bom dinheiro. Esse é ponto de partida para uma ação desenfreada, uma verdadeira corrida contra o tempo quando vários personagens, entre eles o entregador, os receptores e os traficantes, cada um com objetivos diferentes, saem em uma busca alucinante atrás do tal pacote.","first_air_date":"2009-02-06","runtime":84,"episode_run_time":[84],"vote_average":5.2,"created_by":["Melee Entertainment","Next Day Air Productions","Secret Society Films"],"production_companies":[{"name":"Melee Entertainment"},{"name":"Next Day Air Productions"},{"name":"Secret Society Films"}],"cast":["Yasmin Deliz","Donald Faison","Yasiin Bey","Mike Epps","Wood Harris"],"backdrop_path":"https://image.tmdb.org/t/p/original/jfPlonHxKl6Vsygu3TLrL9io5IJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/e8BWhGPDGZOaJPgOvGeV4WFmUlg.jpg","certification":"16","genres":["Ação","Comédia","Crime"],"trailer":"N/A"},
