"348672":{"id":"348672","name":"Sobre a Eternidade","slug":"sobre-a-eternidade","original_title":"Om det oändliga","overview":"Uma reflexão sobre a vida em toda sua beleza e crueldade, seu esplendor e banalidade. Às virtudes e defeitos das pessoas, ao amor e à perda. Tudo isso através da figura de Anna Sedunova, que dará vida à mulher no trem. A mulher testemunha momentos triviais que refletem a efervescência da vida: um casal vagando pela Alemanha destruída pela guerra, um pai e uma filha tomando chuva, uma adolescente dançando do lado de fora de um café e um exército derrotado marchando para um campo de prisioneiros de guerra. Isso refletirá sua maneira de conceber a vida como um espetáculo cheio de luz e sombras.","first_air_date":"2019-11-15","runtime":78,"episode_run_time":[78],"vote_average":6.5,"created_by":["Roy Andersson Filmproduktion","4½","Essential Filmproduktion","Société Parisienne de Production","ARTE France Cinéma"],"production_companies":[{"name":"Roy Andersson Filmproduktion"},{"name":"4½"},{"name":"Essential Filmproduktion"},{"name":"Société Parisienne de Production"},{"name":"ARTE France Cinéma"}],"cast":["Jan-Eje Ferling","Kristina Ekmark","Martin Serner","Bengt Bergius","Anja Broms"],"backdrop_path":"https://image.tmdb.org/t/p/original/dQgqxHUdcNSmhiM4zebekZnnUII.jpg","poster_path":"https://image.tmdb.org/t/p/original/l3CnvDvdoeyeKZYpPna0tmRtkuA.jpg","certification":"N/A","genres":["Drama","Fantasia","Comédia"],"trailer":"N/A"},
