"534011":{"id":"534011","name":"Falsidade","slug":"falsidade","original_title":"Vals","overview":"As amigas Kim, Abby, Feline e a novata Pippa decidem passar seus últimos dias de folga antes dos exames finais em uma casa de férias isolada nas Ardenas. O que deveria ter sido um fim de semana divertido para meninas logo se transforma em drama. Depois de uma festa com três meninos de uma casa vizinha, Feline desaparece de repente. As meninas não podem ir embora devido a uma espessa camada de neve e não têm sinal de celular. Parece que alguém os está perseguindo e a atmosfera está ficando cada vez mais aterrorizante. As meninas realmente sabem tudo uma sobre a outra e quanta falsidade uma amizade pode suportar?","first_air_date":"2019-01-24","runtime":97,"episode_run_time":[97],"vote_average":6.2,"created_by":["Phanta Film","Goldman Film"],"production_companies":[{"name":"Phanta Film"},{"name":"Goldman Film"}],"cast":["Romy Gevers","Holly Mae Brood","Abbey Hoes","Olivia Lonsdale","Thijs Boermans"],"backdrop_path":"https://image.tmdb.org/t/p/original/amIllfmDiJGvVJe6ti0wtDahxF6.jpg","poster_path":"https://image.tmdb.org/t/p/original/dWV026ImM9l7Q48LByGaNjbtHVr.jpg","certification":"N/A","genres":["Thriller","Terror"],"trailer":"i9B5gbMHtGM"},
"717694":{"id":"717694","name":"O Protocolo de Auschwitz","slug":"o-protocolo-de-auschwitz","original_title":"Správa","overview":"A história real de Freddy e Walter - dois jovens judeus eslovacos, que foram deportados para Auschwitz em 1942. Em 1944, após um planejamento meticuloso e com a ajuda de colegas internos, eles conseguiram escapar. Os dois homens são movidos pela esperança de que suas evidências possam salvar vidas. Feridos, eles voltam pelas montanhas para a Eslováquia. Com a ajuda de estranhos pelo caminho, eles finalmente conseguem cruzar a fronteira e encontrar a resistência e a Cruz Vermelha. Eles compilam um relatório detalhado sobre o genocídio sistemático no campo.","first_air_date":"2021-03-18","runtime":94,"episode_run_time":[94],"vote_average":6.4,"created_by":["Evolution Films","Ostlicht Filmproduktion","DNA Production","RTVS"],"production_companies":[{"name":"Evolution Films"},{"name":"Ostlicht Filmproduktion"},{"name":"DNA Production"},{"name":"RTVS"}],"cast":["Noël Czuczor","Peter Ondrejička","John Hannah","Wojciech Mecwaldowski","Jacek Beler"],"backdrop_path":"https://image.tmdb.org/t/p/original/wklo05ydCD2ZQ8J9o7qcwrFGsLA.jpg","poster_path":"https://image.tmdb.org/t/p/original/uTvodu8Jqq8C5uiEXbsFmto4GJI.jpg","certification":"14","genres":["Drama","História","Guerra"],"trailer":"BSOolt5QIug"},
