"1719":{"id":"1719","name":"Um Só Pecado","slug":"um-so-pecado","original_title":"La Peau douce","overview":"Pierre Lachenay, editor e palestrante conhecido e de meia idade, é casado com Franca, uma mulher desequilibrada e é pai de Sabine, uma garota de 10 anos. Ao viajar a Lisboa para uma palestra, Pierre Lachenay conhece e passa a noite com Nicole, uma aeromoça da Panair do Brasil. Ele quer vê-la mais e mais vezes, viajam para Reims juntos, e Pierre mantêm o caso escondido de sua família, principalmente para poupar sua filha da angústia de uma separação. Nicole está levando o caso muito levemente, mas Pierre, não percebendo os sentimentos e expectativas de Nicole, decide viver com ela. A separação do casal leva a um fim trágico. (e 12 - Estimado 12 Anos) 3 versões de duração: 113 min - Lançamento 119 min - Director's Cut França 110 min - Com Cortes Portugal","first_air_date":"1964-04-20","runtime":119,"episode_run_time":[119],"vote_average":7.2,"created_by":["Les Films du Carrosse","Societé d'Exploitation et de Distribution de Films (SEDIF)","Simar Films"],"production_companies":[{"name":"Les Films du Carrosse"},{"name":"Societé d'Exploitation et de Distribution de Films (SEDIF)"},{"name":"Simar Films"}],"cast":["Françoise Dorléac","Jean Desailly","Nelly Benedetti","Daniel Ceccaldi","Laurence Badie"],"backdrop_path":"https://image.tmdb.org/t/p/original/9yPgh3v4itb0ah4XWgGM4BdAtNa.jpg","poster_path":"https://image.tmdb.org/t/p/original/uEe9Wbvf2R5gSl10fwnpyHPjEsl.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
