"341244":{"id":"341244","name":"O Filme da Minha Vida","slug":"o-filme-da-minha-vida","original_title":"O Filme da Minha Vida","overview":"O jovem Tony (Johnny Massaro) decide retornar a Remanso, Serra Gaúcha, sua cidade natal. Ao chegar, ele descobre que Nicolas (Vincent Cassel), seu pai, voltou para França alegando sentir falta dos amigos e do país de origem. Tony acaba tornando-se professor, e vê-se em meio aos conflitos e inexperiências juvenis.","first_air_date":"2017-08-03","runtime":113,"episode_run_time":[113],"vote_average":7.4,"created_by":["Bananeira Filmes"],"production_companies":[{"name":"Bananeira Filmes"}],"cast":["Johnny Massaro","Vincent Cassel","Bruna Linzmeyer","Selton Mello","Ondina Clais"],"backdrop_path":"https://image.tmdb.org/t/p/original/fHbeYHNSMAEKr5fo82AX9l8B7bt.jpg","poster_path":"https://image.tmdb.org/t/p/original/tZ544US8qblE1saWrvbH2U17vUD.jpg","certification":"14","genres":["Drama"],"trailer":"TDVegL5nfYs"},
"31623":{"id":"31623","name":"Battleground, O Preço da Glória","slug":"battleground-o-preco-da-gloria","original_title":"Battleground","overview":"Um esquadrão da divisão 101st Airborne fica encurralado na cidade sitiada de Bastogne durante a Batalha do Bulge. Nós acompanhamos um grupo de soldados norte-americanos, como eles lutam com os alemães, em um nevado e nebuloso inverno, perto Bastogne na II Guerra Mundial. Eles estão com pouco combustível, rações e munição. Os alemães estão constantemente incentivando a sua rendição via rádio e folhetos. E mais importante, o nevoeiro espesso e abrangente dificulta a movimentação e identificação do inimigo e impede a ajuda pelo apoio aéreo aliado. Este filme centra-se muito mais sobre a psicologia e moral dos soldados do que em cenas de ação e heroísmo.","first_air_date":"1949-11-09","runtime":118,"episode_run_time":[118],"vote_average":6.7,"created_by":["Loew's Incorporated","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Loew's Incorporated"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Van Johnson","John Hodiak","Ricardo Montalban","George Murphy","Marshall Thompson"],"backdrop_path":"https://image.tmdb.org/t/p/original/bam6RudCnYDj8YIZt2vi3bUTxSp.jpg","poster_path":"https://image.tmdb.org/t/p/original/qSrcs7zmF61aRtzmOVPxeBBowap.jpg","certification":"e 10","genres":["Ação","Aventura","Drama","Guerra"],"trailer":"N/A"},
"298614":{"id":"298614","name":"O Que Eu Fiz Para Merecer Isso","slug":"o-que-eu-fiz-para-merecer-isso","original_title":"Une heure de tranquillité","overview":"Michel, apaixonado por jazz, encontra um álbum raro que ele sempre sonhara em ouvir tranquilamente em sua sala de estar, mas o mundo parece ter conspirado contra ele. Sua esposa escolheu aquele momento para fazer uma revelação inoportuna, seu filho chega de repente, um de seus amigos bate à sua porta, enquanto sua mãe não para de ligar para o celular dele, sem mencionar o fato de que, neste dia, ocorre o famoso \"Dia dos Vizinhos\", comemoração francesa que tem o intuito de estreitar as relações entre os vizinhos. Manipulador e mentiroso, Michael se desespera para ter paz. Ainda é possível, atualmente, conseguir uma hora de tranquilidade?","first_air_date":"2014-12-31","runtime":79,"episode_run_time":[79],"vote_average":5.3,"created_by":["Fideline Films","Wild Bunch","OCS","Canal+","TF1 Films Production"],"production_companies":[{"name":"Fideline Films"},{"name":"Wild Bunch"},{"name":"OCS"},{"name":"Canal+"},{"name":"TF1 Films Production"}],"cast":["Christian Clavier","Carole Bouquet","Valérie Bonneton","Rossy de Palma","Stéphane De Groodt"],"backdrop_path":"https://image.tmdb.org/t/p/original/srxYer1Xl8y7qcviSXqYfDjehL9.jpg","poster_path":"https://image.tmdb.org/t/p/original/zel52Eo4hcXGO55mvyJYLiVaGvZ.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
"1214488":{"id":"1214488","name":"Skywalkers: Uma História de Amor","slug":"skywalkers-uma-historia-de-amor","original_title":"Skywalkers: A Love Story","overview":"Colocando à prova os limites do amor e da confiança, um casal decide escalar um dos prédios mais altos do mundo para fazer uma acrobacia.","first_air_date":"2024-07-12","runtime":100,"episode_run_time":[100],"vote_average":7.1,"created_by":["XYZ Films","All Rise Films","Library Films"],"production_companies":[{"name":"XYZ Films"},{"name":"All Rise Films"},{"name":"Library Films"}],"cast":["Angela Nikolau","Ivan Beerkus"],"backdrop_path":"https://image.tmdb.org/t/p/original/3CwKraydx0pon9wRrysJXmDMVJT.jpg","poster_path":"https://image.tmdb.org/t/p/original/gKTT5efOXFWBvVWfbtArjzCA5Jq.jpg","certification":"14","genres":["Documentário","Romance","Thriller"],"trailer":"N/A"},
"516630":{"id":"516630","name":"Assassinato em Sparrow Creek","slug":"assassinato-em-sparrow-creek","original_title":"The Standoff at Sparrow Creek","overview":"Depois de um tiroteio em massa em um funeral policial, o ex-policial recluso Gannon se vê inconscientemente forçado a sair da aposentadoria quando percebe que o assassino pertence à mesma milícia que ele se juntou depois de deixar a força. Entendendo que o tiroteio poderia desencadear uma reação em cadeia da violência do copycat em todo o país, Gannon coloca em quarentena seus companheiros milicianos na serraria remota que eles chamam de sua sede. Lá, ele faz uma série de interrogatórios exaustivos, com a intenção de desentocar o assassino e entregá-lo às autoridades para evitar mais derramamento de sangue.","first_air_date":"2019-01-18","runtime":88,"episode_run_time":[88],"vote_average":6.1,"created_by":["Cinestate","Look to the Sky Films","Madhouse Entertainment","Torfoot Films","XYZ Films","Zero Trans Fat Productions"],"production_companies":[{"name":"Cinestate"},{"name":"Look to the Sky Films"},{"name":"Madhouse Entertainment"},{"name":"Torfoot Films"},{"name":"XYZ Films"},{"name":"Zero Trans Fat Productions"}],"cast":["James Badge Dale","Brian Geraghty","Patrick Fischler","Chris Mulkey","Happy Anderson"],"backdrop_path":"https://image.tmdb.org/t/p/original/svlMtjtTjzrJscBddEvZ7sFACum.jpg","poster_path":"https://image.tmdb.org/t/p/original/l2IpN1WhBeuu2Gt7bVO9XK2Uf6A.jpg","certification":"16","genres":["Crime","Drama","Thriller"],"trailer":"iAxrzIA61pA"},
